y roasting people:\n\nSugar Sammy, Best improv moments, full show "},{"text":"https://youtu.be/f8Sjpf4bJj4","navigationEndpoint":{"clickTrackingParams":"CJMBEM2rARgBIhMItJX_iPGS6gIVmf9VCh1nugxS","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=f8Sjpf4bJj4","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"f8Sjpf4bJj4"}}},{"text":"\n\nAnd Dave Chappelle best moments: "},{"text":"https://youtu.be/6sv-oilMRGA","navigationEndpoint":{"clickTrackingParams":"CJMBEM2rARgBIhMItJX_iPGS6gIVmf9VCh1nugxS","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=6sv-oilMRGA","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"6sv-oilMRGA"}}},{"text":"\n\nBill Burr was never an overnight sensation. It happened gradually. He’s a comedian who has been so consistently hilarious, so consistently impassioned about his jokes, and so consistently on edge that after two decades, hardly anybody can remember a time when they didn’t know Bill Burr.\n\nBut that’s not to say that he’s never the subject of widespread media interest. In 2006, Bill Burr walked onto a stage in Philadelphia in front of an audience that had booed and jeered every comedian who had come up before him, and they treated him the same. That became his shining moment. Bill Burr unleashed a torrent of witty rage that was so glorious that even the angry, rowdy crowd set aside their own inane contempt to laugh in praise of the miracle that they had just witnessed. That moment was special because it defined Bill Burr.\n\nSince then, Burr has been busy as ever. He’s produced a popular podcast (the Monday Morning Podcast), appeared in numerous movies and TV shows, and released four albums and comedy specials.\n\nEnjoy!\n\n👉 Subscribe here: "},{"text":"http://bit.ly/2phCdSU","navigationEndpoint":{"clickTrackingParams":"CJMBEM2rARgBIhMItJX_iPGS6gIVmf9VCh1nugxSSMjr8JOguYaH5QE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2F2phCdSU\ "bill burr podcast","bill burr shows","bill burr best roasts","bill burr conan","bill burr daughter bill burr tickets","bill burr stand up bill burr twitter","bill burr youtube bill burr san francisco","bill burr tour bill burr atlanta","richard pryor","george carlin","eddie griffin","bill burr reaction"],"channelId":"UCMTFtRCrHBJyuu4d4nXR01Q","isOwnerViewing":false,"shortDescription":"Are you tired, as I am, of watching each videos of Bill Burr individually on the Internet? This video was made for you! Here is a tribute to this legendary humorist we all know!\n\nAwesome Bill!\n\nAlso if you love Bill Burr, you should check this video of Sugar Sammy roasting people:\n\nSugar Sammy, Best improv moments, full show https://youtu.be/f8Sjpf4bJj4\n\nAnd Dave Chappelle best moments: https://youtu.be/6sv-oilMRGA\n\nBill Burr was never an overnight sensation. It happened gradually. He’s a comedian who has been so consistently hilarious, so consistently impassioned about his jokes, and so consistently on edge that after two decades, hardly anybody can remember a time when they didn’t know Bill Burr.\n\nBut that’s not to say that he’s never the subject of widespread media interest. In 2006, Bill Burr walked onto a stage in Philadelphia in front of an audience that had booed and jeered every comedian who had come up before him, and they treated him the same. That became his shining moment. Bill Burr unleashed a torrent of witty rage that was so glorious that even the angry, rowdy crowd set aside their own inane contempt to laugh in praise of the miracle that they had just witnessed. That moment was special because it defined Bill Burr.\n\nSince then, Burr has been busy as ever. He’s produced a popular podcast (the Monday Morning Podcast), appeared in numerous movies and TV shows, and released four albums and comedy specials.\n\nEnjoy!\n\n👉 Subscribe here: http://bit.ly/2phCdSU\n🕊️ Follow me on Twitter: http://bit.ly/2Wqea0k\n📽️ See my channel and my over videos here: http://bit
